{"specifications":{"name":"Antonelli Maxi Chocolate Cream Filled Croissant - 80 g / 2.82 oz","retail_price":"$0.99","description":"A delectable creation from Antonelli Industrie Dolciarie, renowned for their expertise in crafting exquisite pastries. This particular offering is a supersized croissant, making it a substantial treat for any occasion.

What sets this pastry apart is its sumptuous filling of smooth and indulgent chocolate cream. The richness of the chocolate combined with the flakiness of the croissant creates a heavenly combination of flavors and textures that is sure to delight the palate.

The versatility of this pastry makes it an ideal choice for various occasions. Whether enjoyed as a quick and convenient breakfast alongside a steaming cup of coffee to kickstart the day or savored as a satisfying snack to indulge in during a break, it promises to satisfy cravings and provide a moment of pure enjoyment.","image":"https://eurofoodmart.com/cdn/shop/files/ANTONELIMAXICHOCOLATE.png?v=1711589242&width=320","brand":"DORA","content_url":"https://eurofoodmart.com/collections/bakery/products/antonelli-maxi-chosolate-cream-filled-croissant-80-g-2-82-oz"}}
